import React from 'react';
import './style.css'
const NavBar = () => {
    return (
        <div class="ui top purple inverted fixed menu">
            <div class='item'>
                <img src="/images/logo.png" alt='empty' />
            </div>
            <a href='/' class="item">Home</a>
            <a href='#' class="item">Chord Generator</a>
        </div>
    )
}

export default NavBar;
